comment:
O instrutor tem boa vontade e conhecimento do tema, mas infelizmente o curso parece mais uma palestra com vários conceitos apresentados, do que um curso para aprendizado.
Abaixo aponto algumas observações importantes para que o curso possa vir com uma roupagem diferente futuramente é assim, atingir o seu objetivo:

1. No descritivo diz sobre prática, mas não há nenhuma. É apresentado uma tabela com dados de área, população e densidade demográfica, mas não vai além disso. Nenhum dos conceitos possui uma atividade a ser desenvolvida junto com o instrutor, algo um pouco incomum dos cursos em linha geral aqui na Udemy;

2. O som/áudio  tem uma qualidade mediana e da 3ª aula em diante ele fica mais abafado ainda e vai assim até o fim;

3. Durante todas os vídeos há um barulho de raspagem (não sei se é de algum objetivo na mesa ou no computador) que ocorre constantemente, o que atrapalha demais a atenção já que a qualidade do áudio é mediana como dito anteriormente;

4. Não vi o material apresentado anexado e como há muitas informações, poderia ter disponibilizado os slides;

5. Embora ele tenha falado sobre o levantamento de informações no Google, não disse e nem apresentou os resultados finais do estudo da lanchonete. Poderia ter apresentado exemplos de mapas, falado sobre o conceito de mapa de calor e coroplético. Para quem nunca fez um antes, provavelmente terá muitas dificuldades de tangibilizar todos os conceitos verbalizados.

6. E por último poderia ter falado de alguns softwares (Qgis) e plataformas que oferecem serviços e dados organizados e atualizados e que não são de alto custo e podem ser contratados por demandas específicas. A ideia aqui é para introduzir o tema apenas e mostrar que há muito mais que o Google Maps, por exemplo.

A ideia do conteúdo em geral é interessante e se esses ajustes forem realizados, tenho certeza de que todos (o instrutor e os alunos) ganharão muito com isso!
